import React from 'react';
import Navbarin from '../components/Navbarin.js';
import {Form} from 'react-bootstrap';
import {Button} from 'react-bootstrap';
import {Container, Col, Row} from 'react-bootstrap';
export default class Profile extends React.Component {

    LoggedInPage() {
        return (
            <div>
                <Navbarin handleLogout={this.handleLogout}/>
                <div id="loggedInDiv">
                    <br/>
                    <Container>
                        <br/>
                        <h1>
                            Hello {this.state.User_Firstname}!
                        </h1>
                        <br/>
                        <Row>
                            <Col>
                                <Form.Group controlId="addfriend">
                                    <Form.Label><h3>Add Friend</h3></Form.Label>
                                    <Form.Control style={{width: "40%"}} name="addFriendText" type="email"
                                                  value={this.state.addFriendText} onChange={this.handleChange}
                                                  placeholder="Add Friend..."/>
                                    <br/>
                                    <div>
                                        <Button name="addbtn" onClick={this.handleAdd}>Add</Button>
                                    </div>
                                </Form.Group>
                            </Col>

                            <Col>
                                <div id="friends"><h3>Friends: </h3>
                                    <ul>
                                        <Friendist friends={this.state.User_Friends} currentComponent={this}
                                                   myEmail={this.state.User_Email}></Friendist>
                                    </ul>
                                </div>
                            </Col>
                        </Row>
                        <Col>
                            <h3>Friend Recommendations:</h3>
                            <ListRecs recs={this.state.User_Recommendations}> </ListRecs>
                        </Col>
                    </Container>
                </div>
            </div>
        );
    }


    render() {
        return this.LoggedInPage();
    }
}
